// App.js
import React from 'react';
import UserProfileCard from './components/UserProfileCard';

function App() {
  // Assuming userData is fetched from the backend
  const userData = {
    name: 'John Doe',
    email: 'john.doe@example.com',
    businessType: 'Retail',
    businessBranches: 3,
    phoneNumber: '+1234567890',
    company: 'XYZ Corporation',
    expectedCredit: '$10,000',
    numEmployees: 50,
  };

  return (
    <div className="App">
      <UserProfileCard userData={userData} />
    </div>
  );
}

export default App;
